export default function DisplayCard({ data, regenerateHeadline }) {
  return (
    <div className="bg-white p-6 rounded-xl shadow w-full max-w-md mt-6">
      <p className="text-lg font-semibold mb-1">‚≠ê Google Rating: {data.rating}</p>
      <p className="mb-2">üìù Reviews: {data.reviews}</p>
      <p className="italic text-gray-600">"{data.headline}"</p>
      <button
        onClick={regenerateHeadline}
        className="mt-4 bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
      >
        Regenerate SEO Headline
      </button>
    </div>
  );
}
